import React from "react";
import { Route, Switch } from "react-router-dom";
import { connect } from "react-redux";
import { createStructuredSelector } from "reselect";

import { fetchCollectionsStartAsync } from "../../redux/shop/shop-actions";
import { selectIsCollectionFetching } from "../../redux/shop/shop-selectors";

import CollectionOverview from "../../components/collection-overview/collection-overview.component";
import CollectionPage from "../../pages/collection/collection-page.component";
import WithSpinner from "../../components/with-spinner/withSpinner.component";

const CollectionPageWithSpinner = WithSpinner(CollectionPage);
const CollectionOverviewWithSpinner = WithSpinner(CollectionOverview);

class Shop extends React.Component {
  componentDidMount() {
    console.log(this.props);
    const { fetchCollectionsStartAsync } = this.props;
    fetchCollectionsStartAsync();
    const { selectIsCollectionFetching } = this.props;
  }
  render() {
    const { match } = this.props;
    console.log(selectIsCollectionFetching);

    return (
      <div className="shop-page">
        <Switch></Switch>
      </div>
    );
  }
}

const mapStateToProps = createStructuredSelector({
  selectIsCollectionFetching: selectIsCollectionFetching,
});

const mapDispatchToProps = (dispatch) => ({
  fetchCollectionsStartAsync: () => dispatch(fetchCollectionsStartAsync()),
});

export default connect(mapStateToProps, mapDispatchToProps)(Shop);
